import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import Clock from "react-clock";

function Header() {

  const [value, setValue] = useState
  return (
    <header>
      <Clock></Clock>
      <h1>
      <FilterVintageIcon 
      className="icon" 
      fontSize="large" />
      <FilterVintageIcon 
      className="icon" 
      fontSize="medium"/> 
      Save a note
      <FilterVintageIcon 
      className="icon"  
      fontSize="medium"/>
      <FilterVintageIcon 
      className="icon" 
      fontSize="large"/>
      </h1>
    </header>
  );
}

export default Header;
